import React, { useState } from "react";
import { Link } from "react-router-dom";


const ProfileCard = ({ name, nationalId, college, academicLevel, email }) => {
  const [editMode, setEditMode] = useState(false);

  const handleEdit = () => {
    setEditMode(true);
  };

  const handleSave = () => {
    // Save the edited profile information
    setEditMode(false);
  };
  const [isOpen, setIsOpen] = useState(false);
  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };
  return (
    <>
    <nav className="bg-purple-900 md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 fixed w-full top-0 z-10">
        <div className="container mx-auto flex flex-col md:flex-row md:justify-between md:items-center">
          <div className="flex justify-between items-center w-full md:w-auto">
            
            <button
              onClick={toggleDropdown}
              className="md:hidden text-yellow-500 hover:text-orange-600 focus:outline-none"
            >
              ☰
            </button>
          </div>
          <ul className={`md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 ${isOpen ? 'block' : 'hidden'}`}>
            <li><Link to="/home" className="text-white m-2 hover:text-orange-600 font-blond text-lg">Home</Link></li>
            <li><Link to="/profile" className="text-white hover:text-orange-600 m-2 font-blond text-lg">Profile</Link></li>
            <li><Link to="/about" className="text-white hover:text-orange-600 m-2 font-blond text-lg">About</Link></li>
            <li><Link to="/contact" className="text-white hover:text-orange-600 m-2 font-blond text-lg">Contact</Link></li>
          </ul>
        </div>
      </nav>

    <div className="max-w-sm bg-white border border-gray-200 rounded-lg shadow p-5 pt-24">
      <div className="flex items-center justify-between">
        <div>
          <h5 className="text-2xl font-bold text-gray-900">{name}</h5>
          <p className="text-gray-700">{college}</p>
          <p className="text-gray-700">{academicLevel}</p>
        </div>
        {!editMode && (
          <button
            onClick={handleEdit}
            className="bg-blue-700 hover:bg-green-600 text-white font-medium py-2 px-3 rounded-lg"
          >
            Edit
          </button>
        )}
      </div>
      <div className="mt-5">
        <p className="text-gray-500 font-bold">National ID: {nationalId}</p>
        <p className="text-gray-500 font-bold">Email: {email}</p>
      </div>
      {editMode && (
        <div className="mt-5">
          {/* Input fields for editing */}
          <input
            type="text"
            placeholder="Name"
            className="border border-gray-300 rounded px-2 py-1"
          />
          <input
            type="text"
            placeholder="National ID"
            className="border border-gray-300 rounded px-2 py-1"
          />
          <input
            type="text"
            placeholder="College"
            className="border border-gray-300 rounded px-2 py-1"
          />
          <input
            type="text"
            placeholder="Academic Level"
            className="border border-gray-300 rounded px-2 py-1"
          />
          <input
            type="email"
            placeholder="Email"
            className="border border-gray-300 rounded px-2 py-1"
          />
          <div className="flex justify-end mt-2">
            <button
              onClick={handleSave}
              className="bg-green-500 hover:bg-green-600 text-white font-medium py-1 px-2 rounded"
            >
              Save
            </button>
          </div>
        </div>
      )}
    </div>
    </>
  );
};

export default ProfileCard;
